    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Trempealeau NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Trempealeau NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, public involvement, the affected environment,
     information on the management direction, and strategies for plan implementation.
    Key planning issues include: landscape, wildlife and habitat, public uses, community,
